(72, 1, '2020-12-09 15:42:58', '2020-12-09 15:42:58', 'Program Pengembangan Penilaian Mutu Pendidikan Tinggi Vokasi Berstandar Industri merupakan sebuah program yang digagas oleh Direktorat Kemitraan dan Penyelarasan Dunia Usaha dan Dunia Industri (Dit. Mitras DUDI), Direktorat Jenderal Pendidikan Vokasi, Kementerian Pendidikan dan Kebudayaan (Kemendibud) dalam rangka mewujudkan link and match antara kebutuhan kompetensi industri dan kompetensi yang dimiliki oleh lulusan Pendidikan Tinggi Vokasi.\n\nHal ini dilakukan melalui penyusunan skema sertifikasi kompetensi nasional di level 5 dan 6 (Diploma) yang dilakukan oleh Perguruan Tinggi Vokasi(PTV) pengampu program bersama industri, dunia usaha, dan dunia kerja (IDUKA), serta stakeholders terkait.', 'Definisi Program', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-12-09 15:42:58', '2020-12-09 15:42:58', '', 2, 'http://localhost/petavokasi/2020/12/09/2-revision-v1/', 0, 'revision', '', 0),
