(768, 1, '2020-12-11 03:12:08', '2020-12-11 03:12:08', '<div class=\"sec sec-gray\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Definisi Program</h3>\nProgram Pengembangan Penilaian Mutu Pendidikan Tinggi Vokasi Berstandar Industri merupakan sebuah program yang digagas oleh Direktorat Kemitraan dan Penyelarasan Dunia Usaha dan Dunia Industri (Dit. Mitras DUDI), Direktorat Jenderal Pendidikan Vokasi, Kementerian Pendidikan dan Kebudayaan (Kemendibud) dalam rangka mewujudkan link and match antara kebutuhan kompetensi industri dan kompetensi yang dimiliki oleh lulusan Pendidikan Tinggi Vokasi.\n\nHal ini dilakukan melalui penyusunan skema sertifikasi kompetensi nasional di level 5 dan 6 (Diploma) yang dilakukan oleh Perguruan Tinggi Vokasi(PTV) pengampu program bersama industri, dunia usaha, dan dunia kerja (IDUKA), serta stakeholders terkait.\n\n</div>\n</div>\n<div class=\"col-md-5\">\n                            	<img src=\"https://images.unsplash.com/photo-1512314889357-e157c22f938d?ixlib=rb-1.2.1&amp;ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;auto=format&amp;fit=crop&amp;w=751&amp;q=80\"></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-wh\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-5\">\n                            	<img src=\"https://images.unsplash.com/photo-1500930540495-e92875696a16?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;ixlib=rb-1.2.1&amp;auto=format&amp;fit=crop&amp;w=764&amp;q=80\"></div>\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Tujuan Program</h3>\n<ol>\n 	<li>Membentuk skema sertifikasi nasional berdasarkan KKNI level 5 dan 6.</li>\n 	<li>Menyusun skema sertifikasi yang ditetapkan dan disusun bersama IDUKA dan asosiasi profesi.</li>\n 	<li>Membawa Industri ke kampus dalam pencapaian standar kompetensi.</li>\n 	<li>Menghasilkan materi uji kompetensi dan perangkat uji sesuai dengan harapan IDUKA.</li>\n 	<li>Membentuk tempat uji kompetensi (TUK) mengacu pada standar industri dan bisa menjadi acuan standar nasional.</li>\n 	<li>Meningkatkan kepercayaan IDUKA terhadap pelaksanaan sertifikasi kompetensi.</li>\n 	<li>Menciptakan ekosistem kolaborasi yang baik antara PTV, IDUKA, dan asosiasi profesi dalam memperkuat kemitraan berbasis kerja bersama membangun Indonesia.</li>\n 	<li>Membangun kesadaran publik tentang peran strategis Pendidikan Vokasi di masa depan.</li>\n</ol>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 'Hubungi Kami', '', 'inherit', 'closed', 'closed', '', '766-revision-v1', '', '', '2020-12-11 03:12:08', '2020-12-11 03:12:08', '', 766, 'https://jasaku.com/testing/766-revision-v1/', 0, 'revision', '', 0),
(773, 1, '2020-12-11 03:14:57', '2020-12-11 03:14:57', '<div class=\"sec sec-gray\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Definisi Program</h3>\nProgram Pengembangan Penilaian Mutu Pendidikan Tinggi Vokasi Berstandar Industri merupakan sebuah program yang digagas oleh Direktorat Kemitraan dan Penyelarasan Dunia Usaha dan Dunia Industri (Dit. Mitras DUDI), Direktorat Jenderal Pendidikan Vokasi, Kementerian Pendidikan dan Kebudayaan (Kemendibud) dalam rangka mewujudkan link and match antara kebutuhan kompetensi industri dan kompetensi yang dimiliki oleh lulusan Pendidikan Tinggi Vokasi.\n\nHal ini dilakukan melalui penyusunan skema sertifikasi kompetensi nasional di level 5 dan 6 (Diploma) yang dilakukan oleh Perguruan Tinggi Vokasi(PTV) pengampu program bersama industri, dunia usaha, dan dunia kerja (IDUKA), serta stakeholders terkait.\n\n</div>\n</div>\n<div class=\"col-md-5\"><img src=\"https://images.unsplash.com/photo-1512314889357-e157c22f938d?ixlib=rb-1.2.1&amp;ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;auto=format&amp;fit=crop&amp;w=751&amp;q=80\" /></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-wh\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-5\"><img src=\"https://images.unsplash.com/photo-1500930540495-e92875696a16?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;ixlib=rb-1.2.1&amp;auto=format&amp;fit=crop&amp;w=764&amp;q=80\" /></div>\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Tujuan Program</h3>\n<ol>\n 	<li>Membentuk skema sertifikasi nasional berdasarkan KKNI level 5 dan 6.</li>\n 	<li>Menyusun skema sertifikasi yang ditetapkan dan disusun bersama IDUKA dan asosiasi profesi.</li>\n 	<li>Membawa Industri ke kampus dalam pencapaian standar kompetensi.</li>\n 	<li>Menghasilkan materi uji kompetensi dan perangkat uji sesuai dengan harapan IDUKA.</li>\n 	<li>Membentuk tempat uji kompetensi (TUK) mengacu pada standar industri dan bisa menjadi acuan standar nasional.</li>\n 	<li>Meningkatkan kepercayaan IDUKA terhadap pelaksanaan sertifikasi kompetensi.</li>\n 	<li>Menciptakan ekosistem kolaborasi yang baik antara PTV, IDUKA, dan asosiasi profesi dalam memperkuat kemitraan berbasis kerja bersama membangun Indonesia.</li>\n 	<li>Membangun kesadaran publik tentang peran strategis Pendidikan Vokasi di masa depan.</li>\n</ol>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-gray\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Manfaat Program</h3>\n<h4><strong>Bagi Pemerintah</strong></h4>\n<ol>\n 	<li>Menguatkan pendidikan tinggi vokasi Indonesia yang berbasis pada kemitraan dan kebutuhan IDUKA</li>\n 	<li>Menghasilkan dokumen skema sertifikasi nasional berdasarkan KKNI level 5 dan 6 pada bidang prioritas yang digunakan sebagai instrumen sertifikasi kompetensi lulusan vokasi</li>\n</ol>\n<h4><strong>Bagi Pendidikan Tinggi Vokasi</strong></h4>\n<ol>\n 	<li>Memperkuat LSP P1 PTV</li>\n 	<li>Menguatkan kemitraan dengan IDUKA dan Asosiasi Profesi\nPeningkatan kapasitas dan kualitas infrastruktur sertifikasi</li>\n</ol>\n<h4><strong>Bagi Industri</strong></h4>\n<ol>\n 	<li>Menghasilkan SDM yang kompetensinya sesuai dengan standar industri</li>\n 	<li>Meningkatkan produktivitas industri</li>\n</ol>\n</div>\n</div>\n<div class=\"col-md-5\"><img src=\"https://images.unsplash.com/photo-1517486808906-6ca8b3f04846?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;ixlib=rb-1.2.1&amp;auto=format&amp;fit=crop&amp;w=387&amp;q=80\" /></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-wh\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"sec-txt text-center\">\n<h3>Tahapan Penyusunan Skema Sertifikasi Kompetensi Nasional</h3>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-gray\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-2 col-4\">\n<div class=\"logo-item\"><a title=\"\" href=\"#!\">\n<img src=\"https://jasaku.com/testing/wp-content/themes/petavokasi/images/logo-kemendikbud.png\" />\nKementerian Pendidikan dan Kebudayaan\n</a></div>\n</div>\n<div class=\"col-md-2 col-4\">\n<div class=\"logo-item\"><a title=\"\" href=\"#!\">\n<img src=\"https://jasaku.com/testing/wp-content/themes/petavokasi/images/logo-bnsp.png\" />\nBadan Nasional Sertifikasi Profesi\n</a></div>\n</div>\n<div class=\"col-md-2 col-4\">\n<div class=\"logo-item\"><a title=\"\" href=\"#!\">\n<img src=\"https://jasaku.com/testing/wp-content/themes/petavokasi/images/logo-bappenas.png\" />\nBadan Perencanaan Pembangunan Nasional\n</a></div>\n</div>\n<div class=\"col-md-2 col-4\">\n<div class=\"logo-item\"><a title=\"\" href=\"#!\">\n<img src=\"https://jasaku.com/testing/wp-content/themes/petavokasi/images/logo-kadin.png\" />\nKamar Dagang dan Industri Indonesia\n</a></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 'Tentang Kami', '', 'inherit', 'closed', 'closed', '', '766-revision-v1', '', '', '2020-12-11 03:14:57', '2020-12-11 03:14:57', '', 766, 'https://jasaku.com/testing/766-revision-v1/', 0, 'revision', '', 0),
