(770, 1, '2020-12-11 03:13:07', '2020-12-11 03:13:07', '<div class=\"sec sec-gray\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Definisi Program</h3>\nProgram Pengembangan Penilaian Mutu Pendidikan Tinggi Vokasi Berstandar Industri merupakan sebuah program yang digagas oleh Direktorat Kemitraan dan Penyelarasan Dunia Usaha dan Dunia Industri (Dit. Mitras DUDI), Direktorat Jenderal Pendidikan Vokasi, Kementerian Pendidikan dan Kebudayaan (Kemendibud) dalam rangka mewujudkan link and match antara kebutuhan kompetensi industri dan kompetensi yang dimiliki oleh lulusan Pendidikan Tinggi Vokasi.\n\nHal ini dilakukan melalui penyusunan skema sertifikasi kompetensi nasional di level 5 dan 6 (Diploma) yang dilakukan oleh Perguruan Tinggi Vokasi(PTV) pengampu program bersama industri, dunia usaha, dan dunia kerja (IDUKA), serta stakeholders terkait.\n\n</div>\n</div>\n<div class=\"col-md-5\">\n                            	<img src=\"https://images.unsplash.com/photo-1512314889357-e157c22f938d?ixlib=rb-1.2.1&amp;ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;auto=format&amp;fit=crop&amp;w=751&amp;q=80\"></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"sec sec-wh\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-11\">\n<div class=\"row\">\n<div class=\"col-md-5\">\n                            	<img src=\"https://images.unsplash.com/photo-1500930540495-e92875696a16?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&amp;ixlib=rb-1.2.1&amp;auto=format&amp;fit=crop&amp;w=764&amp;q=80\"></div>\n<div class=\"col-md-7\">\n<div class=\"sec-txt\">\n<h3>Tujuan Program</h3>\n<ol>\n 	<li>Membentuk skema sertifikasi nasional berdasarkan KKNI level 5 dan 6.</li>\n 	<li>Menyusun skema sertifikasi yang ditetapkan dan disusun bersama IDUKA dan asosiasi profesi.</li>\n 	<li>Membawa Industri ke kampu